import React from "react";
import { Avatar, UserInfo } from "./Description.styled";

const Description = ({ avatar, username, location, tag }) => {
  return (
    <UserInfo>
      <Avatar src={avatar} alt="" />
      <h2>{username}</h2>
      <p>{location}</p>
      <p>{tag}</p>
    </UserInfo>
  );
};

export default Description;
